84%D0%BE%D0%BD_%D0%A4%D0%B0%D0%BB%D0%BB%D0%B5%D1%80%D1%81%D0%BB%D0%B5%D0%B1%D0%B5%D0%BD,_%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82_%D0%93%D0%B5%D0%BD%D1%80%D0%B8%D1%85\" title=\"\u0413\u043e\u0444\u043c\u0430\u043d \u0444\u043e\u043d \u0424\u0430\u043b\u043b\u0435\u0440\u0441\u043b\u0435\u0431\u0435\u043d, \u0410\u0432\u0433\u0443\u0441\u0442 \u0413\u0435\u043d\u0440\u0438\u0445\">\u0410\u0432\u0433\u0443\u0441\u0442 \u0413\u0435\u043d\u0440\u0438\u0445 \u0413\u043e\u0444\u0444\u043c\u0430\u043d\u043d \u0444\u043e\u043d \u0424\u0430\u043b\u043b\u0435\u0440\u0441\u043b\u0435\u0431\u0435\u043d<\/a> \u043f\u0440\u0435\u0434\u0441\u0442\u0430\u0432\u0438\u043b \u043d\u0430\u043f\u0438\u0441\u0430\u043d\u043d\u0443\u044e \u0438\u043c \u043f\u0435\u0441\u043d\u044e \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B8%D0%BC%D0%BD_%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D0%B8\" title=\"\u0413\u0438\u043c\u043d \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438\">\u0414\u043e\u0439\u0447\u043b\u0430\u043d\u0434, \u0414\u043e\u0439\u0447\u043b\u0430\u043d\u0434, \u044e\u0431\u0435\u0440 \u0430\u043b\u043b\u0435\u0441<\/a>\u00bb, \u0441\u0442\u0430\u0432\u0448\u0443\u044e \u0433\u0438\u043c\u043d\u043e\u043c \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0438 (\u0441\u043b\u043e\u0432\u0430 \u0431\u044b\u043b\u0438 \u043d\u0430\u043b\u043e\u0436\u0435\u043d\u044b \u043d\u0430 \u0430\u0432\u0441\u0442\u0440\u0438\u0439\u0441\u043a\u0438\u0439 \u0438\u043c\u043f\u0435\u0440\u0441\u043a\u0438\u0439 \u0433\u0438\u043c\u043d <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D0%B0%D0%B9%D0%B4%D0%BD,_%D0%99%D0%BE%D0%B7%D0%B5%D1%84\" title=\"\u0413\u0430\u0439\u0434\u043d, \u0419\u043e\u0437\u0435\u0444\">\u0413\u0430\u0439\u0434\u043d\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1842_%D0%B3%D0%BE%D0%B4\" title=\"1842 \u0433\u043e\u0434\">1842<\/a>&#160;\u2014 \u0421\u043f\u0443\u0441\u0442\u044f 284 \u0433\u043e\u0434\u0430 \u0432\u043e\u0437\u043e\u0431\u043d\u043e\u0432\u0438\u043b\u043e\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%BE%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE\" title=\"\u0421\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e\">\u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%91%D0%BB%D1%8C%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%81%D0%BE%D0%B1%D0%BE%D1%80\" title=\"\u041a\u0451\u043b\u044c\u043d\u0441\u043a\u0438\u0439 \u0441\u043e\u0431\u043e\u0440\">\u041a\u0451\u043b\u044c\u043d\u0441\u043a\u043e\u0433\u043e \u0441\u043e\u0431\u043e\u0440\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1866_%D0%B3%D0%BE%D0%B4\" title=\"1866 \u0433\u043e\u0434\">1866<\/a>&#160;\u2014 \u041e\u0442\u043a\u0440\u044b\u0442\u043e \u0434\u0432\u0438\u0436\u0435\u043d\u0438\u0435 \u043f\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D1%8F%D0%B7%D0%B0%D0%BD%D1%81%D0%BA%D0%BE-%D0%9A%D0%BE%D0%B7%D0%BB%D0%BE%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%B0%D1%8F_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B0\" title=\"\u0420\u044f\u0437\u0430\u043d\u0441\u043a\u043e-\u041a\u043e\u0437\u043b\u043e\u0432\u0441\u043a\u0430\u044f \u0436\u0435\u043b\u0435\u0437\u043d\u0430\u044f \u0434\u043e\u0440\u043e\u0433\u0430\">\u0420\u044f\u0437\u0430\u043d\u0441\u043a\u043e-\u041a\u043e\u0437\u043b\u043e\u0432\u0441\u043a\u043e\u0439 \u0436\u0435\u043b\u0435\u0437\u043d\u043e\u0439 \u0434\u043e\u0440\u043e\u0433\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1870_%D0%B3%D0%BE%D0%B4\" title=\"1870 \u0433\u043e\u0434\">1870<\/a>&#160;\u2014 \u0412\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D1%8F\" title=\"\u0424\u0440\u0430\u043d\u0446\u0438\u044f\">\u0424\u0440\u0430\u043d\u0446\u0438\u0438<\/a> \u0431\u044b\u043b \u0441\u0432\u0435\u0440\u0433\u043d\u0443\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80\" title=\"\u0418\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440\">\u0438\u043c\u043f\u0435\u0440\u0430\u0442\u043e\u0440<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B0%D0%BF%D0%BE%D0%BB%D0%B5%D0%BE%D0%BD_III_%D0%91%D0%BE%D0%BD%D0%B0%D0%BF%D0%B0%D1%80%D1%82\" class=\"mw-redirect\" title=\"\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d III \u0411\u043e\u043d\u0430\u043f\u0430\u0440\u0442\">\u041d\u0430\u043f\u043e\u043b\u0435\u043e\u043d III<\/a> \u0438 \u043f\u0440\u043e\u0432\u043e\u0437\u0433\u043b\u0430\u0448\u0435\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B5%D1%82%D1%8C%D1%8F_%D1%84%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0\" title=\"\u0422\u0440\u0435\u0442\u044c\u044f \u0444\u0440\u0430\u043d\u0446\u0443\u0437\u0441\u043a\u0430\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430\">\u0422\u0440\u0435\u0442\u044c\u044f \u0440\u0435\u0441\u043f\u0443\u0431\u043b\u0438\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1882_%D0%B3%D0%BE%D0%B4\" title=\"1882 \u0433\u043e\u0434\">1882<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AD%D0%B4%D0%B8%D1%81%D0%BE%D0%BD,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81_%D0%90%D0%BB%D0%B2%D0%B0\" title=\"\u042d\u0434\u0438\u0441\u043e\u043d, \u0422\u043e\u043c\u0430\u0441 \u0410\u043b\u0432\u0430\">\u0422\u043e\u043c\u0430\u0441 \u042d\u0434\u0438\u0441\u043e\u043d<\/a> \u0432\u043a\u043b\u044e\u0447\u0438\u043b \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u043c\u0438\u0440\u0435 \u043a\u043e\u043c\u043c\u0435\u0440\u0447\u0435\u0441\u043a\u043e\u0435 \u044d\u043b\u0435\u043a\u0442\u0440\u0438\u0447\u0435\u0441\u043a\u043e\u0435 \u043e\u0441\u0432\u0435\u0449\u0435\u043d\u0438\u0435 (\u0432\u0441\u0435\u0433\u043e \u043d\u0430\u0441\u0447\u0438\u0442\u044b\u0432\u0430\u043b\u043e\u0441\u044c 85 \u043f\u043b\u0430\u0442\u043d\u044b\u0445 \u043a\u043b\u0438\u0435\u043d\u0442\u043e\u0432).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1884_%D0%B3%D0%BE%D0%B4\" title=\"1884 \u0433\u043e\u0434\">1884<\/a>&#160;\u2014 \u0412 \u0420\u043e\u0441\u0441\u0438\u0438 \u043e\u0442\u043c\u0435\u043d\u0435\u043d\u0430 \u0430\u0432\u0442\u043e\u043d\u043e\u043c\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A3%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82\" title=\"\u0423\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\">\u0443\u043d\u0438\u0432\u0435\u0440\u0441\u0438\u0442\u0435\u0442\u043e\u0432<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1885_%D0%B3%D0%BE%D0%B4\" title=\"1885 \u0433\u043e\u0434\">1885<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA\" title=\"\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\">\u041d\u044c\u044e-\u0419\u043e\u0440\u043a\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u043e\u0441\u044c \u043f\u0435\u0440\u0432\u043e\u0435 \u0432 \u0421\u043e\u0435\u0434\u0438\u043d\u0451\u043d\u043d\u044b\u0445 \u0428\u0442\u0430\u0442\u0430\u0445 \u043a\u0430\u0444\u0435 \u0441\u0430\u043c\u043e\u043e\u0431\u0441\u043b\u0443\u0436\u0438\u0432\u0430\u043d\u0438\u044f.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1888_%D0%B3%D0%BE%D0%B4\" title=\"1888 \u0433\u043e\u0434\">1888<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D1%81%D1%82%D0%BC%D0%B5%D0%BD,_%D0%94%D0%B6%D0%BE%D1%80%D0%B4%D0%B6\" title=\"\u0418\u0441\u0442\u043c\u0435\u043d, \u0414\u0436\u043e\u0440\u0434\u0436\">\u0414\u0436\u043e\u0440\u0434\u0436 \u0418\u0441\u0442\u043c\u0435\u043d<\/a> \u0437\u0430\u0440\u0435\u0433\u0438\u0441\u0442\u0440\u04