b\u044f<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1914_%D0%B3%D0%BE%D0%B4\" title=\"1914 \u0433\u043e\u0434\">1914<\/a>&#160;\u2014 \u0411\u0440\u0438\u0442\u0430\u043d\u0438\u044f, \u0420\u043e\u0441\u0441\u0438\u044f \u0438 \u0424\u0440\u0430\u043d\u0446\u0438\u044f \u043f\u043e\u043e\u0431\u0435\u0449\u0430\u043b\u0438 \u0434\u0440\u0443\u0433 \u0434\u0440\u0443\u0433\u0443 \u043d\u0435 \u0437\u0430\u043a\u043b\u044e\u0447\u0430\u0442\u044c \u0441\u0435\u043f\u0430\u0440\u0430\u0442\u043d\u044b\u0439 \u043c\u0438\u0440 \u0441 \u0413\u0435\u0440\u043c\u0430\u043d\u0438\u0435\u0439<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1928_%D0%B3%D0%BE%D0%B4\" title=\"1928 \u0433\u043e\u0434\">1928<\/a>&#160;\u2014 \u0421\u043e\u0432\u043d\u0430\u0440\u043a\u043e\u043c \u0423\u043a\u0440\u0430\u0438\u043d\u044b \u0443\u0442\u0432\u0435\u0440\u0434\u0438\u043b \u043d\u043e\u0432\u043e\u0435 \u0443\u043a\u0440\u0430\u0438\u043d\u0441\u043a\u043e\u0435 \u043f\u0440\u0430\u0432\u043e\u043f\u0438\u0441\u0430\u043d\u0438\u0435 (\u0434\u0435\u0439\u0441\u0442\u0432\u043e\u0432\u0430\u043b\u043e \u0434\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/1933_%D0%B3%D0%BE%D0%B4\" title=\"1933 \u0433\u043e\u0434\">1933 \u0433\u043e\u0434\u0430<\/a>).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 \u041d\u0430 \u0423\u043a\u0440\u0430\u0438\u043d\u0435 \u0441\u043e\u0437\u0434\u0430\u043d \u0418\u043d\u0441\u0442\u0438\u0442\u0443\u0442 \u043a\u0440\u0430\u0441\u043d\u043e\u0439 \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u0443\u0440\u044b.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1937_%D0%B3%D0%BE%D0%B4\" title=\"1937 \u0433\u043e\u0434\">1937<\/a><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9B%D0%B8%D0%B3%D0%B0_%D0%9D%D0%B0%D1%86%D0%B8%D0%B9\" title=\"\u041b\u0438\u0433\u0430 \u041d\u0430\u0446\u0438\u0439\">\u041b\u0438\u0433\u0430 \u041d\u0430\u0446